import { Navigate, Route, Routes } from 'react-router-dom';
import Login from './Pages/Login';
import Signup from './Pages/Signup';
import Home from './Pages/Home';
import ChatService from './components/Services/ChatServices/ChatServices'; // Import ChatService
import FindUserForgotPassword from './components/ForgotPassword/FindUserForgotPassword';
import ConfirmAccountPopup from './components/EmailVerification/VerifyCodeConfirmAccount';
import ProtectedRoute from './utils/ProtectedRoute'; // Import ProtectedRoute

function App() {
    return (
        <Routes>
            <Route path='/login' element={<Login />} />
            <Route path='/signup' element={<Signup />} />
            <Route path='/' element={<Navigate to="/login" />} />
            <Route path='/home' element={<ProtectedRoute><Home /></ProtectedRoute>} />


            <Route path='/find-user' element={<FindUserForgotPassword />} /> 
            <Route path='/verify-email' element={<ConfirmAccountPopup />} /> 

           // Protected Service Route
            <Route path='/chat-service' element={<ProtectedRoute><ChatService /></ProtectedRoute>} /> 
            

        </Routes>
    );
}

export default App;
